import React from "react";
import { useSelector, useDispatch } from "react-redux";
import { getFriend } from "../../../features/userSlice";
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Box from '@mui/material/Box';

function TabPanel(props) {
    const { children, value, index, ...other } = props;
  
    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`simple-tabpanel-${index}`}
        aria-labelledby={`simple-tab-${index}`}
        {...other}
      >
        {value === index && (
          <Box sx={{ p: 3 }}>
            {children}
          </Box>
        )}
      </div>
    );
}

function a11yProps(index) {
    return {
      id: `simple-tab-${index}`,
      'aria-controls': `simple-tabpanel-${index}`,
    };
}

const Friend = () => {
    const dispatch = useDispatch();
    const tabs = useSelector(state => state.current.tabs);
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };
    //const friend = useSelector(state => state.user.friend);
    console.log(tabs)

    return(
        <>
            <Box sx={{ width: '100%' }}>
            <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                <Tabs value={value} onChange={handleChange} aria-label="basic tabs example">
                <Tab sx={{textTran}} label="Bạn bè" {...a11yProps(0)} />
                <Tab label="Yêu cầu kết bạn" {...a11yProps(1)} />
                </Tabs>
            </Box>
                <TabPanel value={value} index={0}>
                    Bạn bè
                </TabPanel>
                <TabPanel value={value} index={1}>
                    Yêu cầu kết bạn
                </TabPanel>
            </Box>
        </>
    )
}

export default Friend;
